import React from 'react';
import {connect} from 'redux-bundler-react';

class BaseMapSwitcher extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            expanded: false
        }
    }
    render(){
        const dropdownStyle = {
            position: 'absolute',
            top:0,
            left:0,
            transform: 'translate3d(0px, 35px, 0px'
        }
        return (

            <div className="btn-group mr-2">
                <button type="button" className="btn btn-info dropdown-toggle">
                    BaseMap
                </button>
                <div className="dropdown-menu" style = { dropdownStyle}>
                    <a className="dropdown-menu" href="#">0</a>
                    <a className="dropdown-menu" href="#">1</a>
                </div>
            </div>
        )
    }
}
export default connect(
    BaseMapSwitcher
)
